import React from 'react'

function AccountComponent({accountRaw}) {
    const accountElement = accountRaw.map(account=>{
        return(
            <div>
                <p style={{color: "white"}}>{account.account_value}</p>
            </div>
        )
    })
  return (
    <div>{accountElement}</div>
  )
}

export default AccountComponent
